import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import '../styles/Header.css';

const Header = () => {
  const { isAuthenticated, user, logout } = useAuth();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
    setIsMobileMenuOpen(false);
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          {/* Logo */}
          <Link to="/" className="logo">
            <i className="fas fa-graduation-cap"></i>
            <span>University Portal</span>
          </Link>

          {/* Desktop Navigation */}
          <nav className="nav-desktop">
            <Link to="/" className="nav-link">Home</Link>
            <Link to="/apply" className="nav-link">Admissions</Link>
            <a href="#programs" className="nav-link">Programs</a>
            <a href="#contact" className="nav-link">Contact Us</a>
          </nav>

          {/* Auth Buttons */}
          <div className="auth-buttons">
            {isAuthenticated ? (
              <div className="user-menu">
                <span className="user-name">
                  <i className="fas fa-user-circle"></i>
                  {user?.fullName}
                </span>
                <div className="dropdown">
                  <Link to="/dashboard" className="dropdown-item">
                    <i className="fas fa-tachometer-alt"></i>
                    Dashboard
                  </Link>
                  <button onClick={handleLogout} className="dropdown-item">
                    <i className="fas fa-sign-out-alt"></i>
                    Logout
                  </button>
                </div>
              </div>
            ) : (
              <>
                <Link to="/login" className="btn btn-outline">Login</Link>
              </>
            )}
          </div>

          {/* Mobile Menu Button */}
          <button className="mobile-menu-btn" onClick={toggleMobileMenu}>
            <i className={`fas ${isMobileMenuOpen ? 'fa-times' : 'fa-bars'}`}></i>
          </button>
        </div>

        {/* Mobile Navigation */}
        {isMobileMenuOpen && (
          <nav className="nav-mobile">
            <Link to="/" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
              Home
            </Link>
            <Link to="/apply" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
              Admissions
            </Link>
            <a href="#programs" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
              Programs
            </a>
            <a href="#contact" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
              Contact Us
            </a>
            
            {isAuthenticated ? (
              <>
                <Link to="/dashboard" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
                  Dashboard
                </Link>
                <button onClick={handleLogout} className="nav-link">
                  Logout
                </button>
              </>
            ) : (
              <>
                <Link to="/login" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
                  Login
                </Link>
              </>
            )}
          </nav>
        )}
      </div>
    </header>
  );
};

export default Header;
